	StringBuilder db = new StringBuilder();

	private void consume(String s, ISqlConsumer consumer) {
		ArrayList<String> sm = new ArrayList<String>();
		if (s.charAt(0) == '(') {
			s = s.substring(1);
		}
		int length = s.length();
		db.delete(0, db.length());
		char quote = 0;
		char pc = 0;
		for (int a = 0; a < length; a++) {
			char c = s.charAt(a);

			if (c == '\'') {
				if (quote == '\'') {
					if (pc != '\\') {
						quote = 0;
					}
				} else {
					if (quote == 0) {
						quote = c;
					}
				}
			}
			if (c == '\"') {
				if (quote == '\"') {
					if (pc != '\\') {
						quote = 0;
					}
				} else {
					if (quote == 0) {
						quote = c;
					}
				}
			}
			if (c == ',' && quote == 0) {
				sm.add(db.toString());
				db.delete(0, db.length());
				continue;
			}
			db.append(c);
			if (pc != '\\') {
				pc = c;
			} else {
				pc = 0;
			}
		}
		sm.add(db.toString());
		Object[] rs = new Object[sm.size()];
		int a = 0;
		for (String sq : sm) {
			if (sq.endsWith(");")) {
				sq = sq.substring(0, sq.length() - 2);
			}
			try {
				if (sq.length()>0&&Character.isDigit(sq.charAt(0))){
				int parseLong = Integer.valueOf(sq);
				rs[a++] = parseLong;
				continue;
				}
			} catch (NumberFormatException e) {
				// TODO: handle exception
			}
			if (sq.charAt(0) == '\'') {
				rs[a++] = sq.substring(1, sq.length() - 1);
				continue;
			} else {
				if (sq.charAt(0) == '"') {
					rs[a++] = sq.substring(1, sq.length() - 1);
					continue;
				}
			}
			rs[a] = sq;
		}
		try{
		consumer.consume(rs);
		}catch (Exception e) {
			e.printStackTrace();
		}
	}

